var handleCalendarDemo = function() {
    $("#external-events .fc-event").each(function() {
        $(this).data("event", {
            title: $.trim($(this).text()),
            stick: !0,
            color: $(this).attr("data-color") ? $(this).attr("data-color") : ""
        }), $(this).draggable({
            zIndex: 999,
            revert: !0,
            revertDuration: 0
        });
    });
    var a = new Date(), b = a.getFullYear(), c = a.getMonth() + 1;
    c = 10 > c ? "0" + c : c, $("#calendar").fullCalendar({
        header: {
            left: "month,agendaWeek,agendaDay",
            center: "title",
            right: "prev,today,next "
        },
        droppable: !0,
        drop: function() {
            $(this).remove();
        },
        selectable: !0,
        selectHelper: !0,
        select: function(a, b) {
            var c, d = prompt("Event Title:");
            d && (c = {
                title: d,
                start: a,
                end: b
            }, $("#calendar").fullCalendar("renderEvent", c, !0)), $("#calendar").fullCalendar("unselect");
        },
        editable: !0,
        eventLimit: !0,
        events: [ {
            title: "All Day Event",
            start: b + "-" + c + "-01",
            color: "#00acac"
        }, {
            title: "Long Event",
            start: b + "-" + c + "-07",
            end: b + "-" + c + "-10"
        }, {
            id: 999,
            title: "Repeating Event",
            start: b + "-" + c + "-09T16:00:00",
            color: "#00acac"
        }, {
            id: 999,
            title: "Repeating Event",
            start: b + "-" + c + "-16T16:00:00"
        }, {
            title: "Conference",
            start: b + "-" + c + "-11",
            end: b + "-" + c + "-13"
        }, {
            title: "Meeting",
            start: b + "-" + c + "-12T10:30:00",
            end: b + "-" + c + "-12T12:30:00",
            color: "#00acac"
        }, {
            title: "Lunch",
            start: b + "-" + c + "-12T12:00:00",
            color: "#348fe2"
        }, {
            title: "Meeting",
            start: b + "-" + c + "-12T14:30:00"
        }, {
            title: "Happy Hour",
            start: b + "-" + c + "-12T17:30:00"
        }, {
            title: "Dinner",
            start: b + "-" + c + "-12T20:00:00"
        }, {
            title: "Birthday Party",
            start: b + "-" + c + "-13T07:00:00"
        }, {
            title: "Click for Google",
            url: "http://google.com/",
            start: b + "-" + c + "-28",
            color: "#ff5b57"
        } ]
    });
}, Calendar = function() {
    "use strict";
    return {
        init: function() {
            handleCalendarDemo();
        }
    };
}();